import React from 'react';

function Countries(props) {
    return(
        <div className = 'box'>
        <div style={{ width: '20rem',border: 'none'}}>
          <img variant="top" src={props.src} />
          <tr>
            {/* <td style = {{fontWeight: 'bold', fontSize: '28px'}}>{props.country}</td> */}
            <td style = {{borderBottom: '0.02px solid grey'}}><span style ={{fontWeight: 'bold'}}>Cases: </span>{props.cases}</td>
            <td style = {{borderBottom: '0.02px solid grey'}}><span style ={{fontWeight: 'bold'}}>Recovered: </span>{props.recovered}</td>
            <td style = {{borderBottom: '0.02px solid grey'}}><span style ={{fontWeight: 'bold'}}>Deaths: </span>{props.deaths}</td>
            <td style = {{borderBottom: '0.02px solid grey'}}><span style ={{fontWeight: 'bold'}}>Active: </span>{props.active}</td>
            <td style = {{borderBottom: '0 solid grey'}}><span style ={{fontWeight: 'bold'}}>Critical: </span>{props.critical}</td>
          </tr>
        </div>
      </div>
    )
}

export default Countries
